import React from "react";
import { Link } from 'react-router-dom';
const Navbar = ()=>{
    return(
        <nav>
            <Link>HOME</Link>
            <Link>ABOUT</Link>
            <Link>TEAM</Link>
            <Link>SERVICES</Link>
            <Link>WORK</Link>
            <Link>CLIENTS</Link>
            <Link>CONTACT</Link>
        </nav>
    )
}
export default Navbar
